import React, { Component } from 'react'
import styled from 'styled-components'

const Container= styled.div`
  background: black;
  border: solid 1px white;
  display: flex;
  margin: 5px;
`

class Skills extends Component {
  render() {
    return (
      <Container>
        <h1>
          Skills
        </h1>
      </Container>
    )
  }
}

export default Skills
